import { useState } from 'react'

function getCommandByInput() {
    const [command, setCommand] = useState('')
    function Input() {
        const handleInput = (e) => {
            setCommand(e.target.value)
        }
        return (
          <input onChange={handleInput}/>
        )
    }
    return {
        command,
        Input
    }
}

export const command = getCommandByInput().command

export const Input = getCommandByInput().Input
